import React from "react";

const Form = ()=>{
    return(
        <div className="form-container">
            <div className="form-input-container">
                <input type="text" placeholder="Vaccine name" />
                <input type="date" className="date"/>
                <input type="date" className="date"/>
            </div>
        </div>
    )
}

export default Form;
